instruction:
分析以下价格政策文档，识别节点"实景演艺门票"的所有价格条件，支持多层条件嵌套：

请返回JSON格式：
{
    "node_name": "实景演艺门票",
    "price_conditions": [
        {
            "price": 价格数值,
            "unit": "单位",
            "conditions": [
                {
                    "condition_name": "条件名称",
                    "condition_value": "条件值",
                    "restrictions": [
                        {
                            "restriction_type": "限制类型",
                            "operator": "操作符",
                            "value": "限制值"
                        }
                    ]
                }
            ]
        }
    ]
}

【重要说明】
1. **价格条件**：指能够影响价格的因素，如"门市价"、"团队价"、"标准价"、"旺季价"、"淡季价"等
2. **表格列标题不是价格条件**：如"适用对象"、"有效期"、"备注"等是表格结构，不是价格条件
3. **简单价格结构**：如果文档只有一个固定价格，没有不同的价格类型，则conditions为空数组
4. **限制条件**：指对价格条件的内部限制说明，如"团队人数≥10人"、"年龄≥55岁"等

【判断标准】
- 如果文档中只有一个价格，没有提到"门市价"、"团队价"、"旺季价"等不同价格类型，则conditions为空数组
- 如果文档提到多种价格类型（如门市价、协议价、团队价），则每个价格类型创建一个condition
- 表格的列标题（如"适用对象"、"有效期"、"备注"）不属于价格条件

条件层次说明：
- **单条件**：只需要一个条件就能确定价格
  例如：门市价、团队价、标准价等

- **双条件**：需要两个条件组合才能确定价格
  例如：地区+团队类型、季节+房型等

- **多条件**：需要多个条件组合才能确定价格
  例如：地区+团队类型+协议状态等

Few-shot示例：

示例1 - 简单价格（无价格条件）：
{
    "price": 100,
    "unit": "人次",
    "conditions": []  // 只有一个固定价格，无价格条件
}

示例2 - 单价格条件（无条件限制）：
{
    "price": 100,
    "unit": "人次",
    "conditions": [
        {
            "condition_name": "门市价",
            "condition_value": "门市价",
            "restrictions": []
        }
    ]
}

示例3 - 单价格条件（有条件限制）：
{
    "price": 80,
    "unit": "人次",
    "conditions": [
        {
            "condition_name": "团队价",
            "condition_value": "团队价",
            "restrictions": [
                {
                    "restriction_type": "团队人数",
                    "operator": "≥",
                    "value": "10人"
                }
            ]
        }
    ]
}

示例4 - 双价格条件组合：
{
    "price": 60,
    "unit": "人次",
    "conditions": [
        {
            "condition_name": "地区",
            "condition_value": "本地",
            "restrictions": []
        },
        {
            "condition_name": "协议成团价",
            "condition_value": "协议成团价",
            "restrictions": []
        }
    ]
}

示例5 - 多价格条件组合：
{
    "price": 50,
    "unit": "人次",
    "conditions": [
        {
            "condition_name": "地区",
            "condition_value": "本地",
            "restrictions": []
        },
        {
            "condition_name": "团队类型",
            "condition_value": "学生团队",
            "restrictions": [
                {
                    "restriction_type": "学生占比",
                    "operator": "≥",
                    "value": "80%"
                }
            ]
        },
        {
            "condition_name": "协议状态",
            "condition_value": "协议客户",
            "restrictions": []
        }
    ]
}

示例6 - 产品细分（同一服务下的不同产品线）：
{
    "price": 30,
    "unit": "人次",
    "conditions": [
        {
            "condition_name": "门市价",
            "condition_value": "门市价",
            "restrictions": []
        }
    ]
}

注意：产品细分不是联票套餐，而是同一服务的不同产品线
- "新安江游船价格政策：梦幻新安江，江清月近人" → 船费服务
- "丛林探险价格政策：亲子线，成人线" → 体验活动

