分析以下价格政策文档，识别节点"门票"的所有价格条件，支持多层条件嵌套：

请返回JSON格式：
{
    "node_name": "门票",
    "price_conditions": [
        {
            "price": 价格数值,
            "unit": "单位",
            "conditions": [
                {
                    "condition_name": "条件名称",
                    "condition_value": "条件值",
                    "restrictions": [
                        {
                            "restriction_type": "限制类型",
                            "operator": "操作符",
                            "value": "限制值"
                        }
                    ]
                }
            ]
        }
    ]
}

【重要说明】
1. **价格条件**：指能够影响价格的因素，如"门市价"、"团队价"、"标准价"、"旺季价"、"淡季价"等
2. **表格列标题不是价格条件**：如"适用对象"、"有效期"、"备注"等是表格结构，不是价格条件
3. **简单价格结构**：如果文档只有一个固定价格，没有不同的价格类型，则conditions为空数组
4. **限制条件**：指对价格条件的内部限制说明，如"团队人数≥10人"、"年龄≥55岁"等
5. **提取准则**：如果文档中有多种价格类型但价格相同，也需要创建多个price_conditions项

【判断标准】
- 如果文档中只有一个价格，没有提到"门市价"、"团队价"、"旺季价"等不同价格类型，则conditions为空数组
- 如果文档提到多种价格类型（如门市价、协议价、团队价），则每个价格类型创建一个condition
- 表格的列标题（如"适用对象"、"有效期"、"备注"）不属于价格条件

条件层次说明：
- **单条件**：只需要一个条件就能确定价格
  例如：门市价、团队价、标准价等

- **双条件**：需要两个条件组合才能确定价格
  例如：地区+团队类型、季节+房型等

- **多条件**：需要多个条件组合才能确定价格
  例如：地区+团队类型+协议状态等

