instruction:
分析以下联票套餐价格政策文档，识别产品"大慈岩门票"的价格信息：

请返回JSON格式：
{
    "node_name": "大慈岩门票",
    "price_conditions": [
        {
            "price": 价格数值,
            "unit": "人次",
            "conditions": [
                {
                    "condition_name": "条件",
                    "condition_value": "条件名称",
                    "restrictions": []
                }
            ]
        }
    ]
}

注意：
1. 单位统一使用"人次"
2. 从表格中提取产品"大慈岩门票"对应的价格数值
3. 联票套餐中每个产品通常只有一个价格
4. 如果没有特殊条件，conditions可以为空数组
5. "conditions"中的条件可以是对应的子产品，也可以是适用的地区时间等限制条件，没有可以不填写，直接为空数组
5. 只返回JSON，不要其他解释

分析以下酒店住宿价格政策文档，识别房型"家庭房"的所有价格条件：

请返回JSON格式：
{
    "node_name": "家庭房",
    "price_conditions": [
        {
            "price": 价格数值,
            "unit": "房，晚",
            "conditions": [
                {
                    "condition_name": "条件名称",
                    "condition_value": "条件值",
                    "restrictions": [
                        {
                            "restriction_type": "限制类型",
                            "operator": "操作符",
                            "value": "限制值"
                        }
                    ]
                }
            ]
        }
    ]
}

【重要说明】
1. **价格条件**：指能够影响价格的因素，如"标准价"、"旺季价"、"淡季价"、"团队价"、"周末价"等
2. **表格列标题不是价格条件**：如"适用对象"、"有效期"、"备注"等是表格结构，不是价格条件
3. **简单价格结构**：如果文档只有一个固定价格，没有不同的价格类型，则conditions为空数组
4. **限制条件**：指对价格条件的内部限制说明，如"旺季时间"、"团队人数≥10间"等

【判断标准】
- 如果文档中只有一个价格，没有提到"标准价"、"旺季价"、"团队价"等不同价格类型，则conditions为空数组
- 如果文档提到多种价格类型（如标准价、旺季价、淡季价），则每个价格类型创建一个condition
- 表格的列标题（如"适用对象"、"有效期"、"备注"）不属于价格条件

Few-shot示例：

示例1 - 简单价格（无价格条件）：
{
    "price": 300,
    "unit": "房，晚",
    "conditions": []  // 只有一个固定价格，无价格条件
}

示例2 - 单价格条件（无条件限制）：
{
    "price": 300,
    "unit": "房，晚",
    "conditions": [
        {
            "condition_name": "标准价",
            "condition_value": "标准价",
            "restrictions": []
        }
    ]
}

示例3 - 单价格条件（有条件限制）：
{
    "price": 500,
    "unit": "房，晚",
    "conditions": [
        {
            "condition_name": "旺季价",
            "condition_value": "旺季价",
            "restrictions": [
                {
                    "restriction_type": "旺季时间",
                    "operator": "=",
                    "value": "7-8月"
                }
            ]
        }
    ]
}

示例4 - 双价格条件组合：
{
    "price": 250,
    "unit": "房，晚",
    "conditions": [
        {
            "condition_name": "季节",
            "condition_value": "淡季",
            "restrictions": []
        },
        {
            "condition_name": "周末价",
            "condition_value": "周末价",
            "restrictions": []
        }
    ]
}

注意：
1. 单位统一使用"房，晚"
2. 条件名称应该是价格政策名称（如标准价、旺季价、淡季价等），不是表格列标题
3. 如果文档只有一个固定价格，conditions为空数组
4. 只返回JSON，不要其他解释。

